import { useState } from 'react'
import Botao from './Botao'
import './sessao.css'
import Axios from 'axios';

export default function SessaoInsert() {

    const [name, setName] = useState('');
    const [amount, setAmount] = useState(0);
    const [price, setPrice] = useState(0);
    const [details, setDetails] = useState('');
    const [description, setDescription] = useState('');


     const addProduct = () => {
        return (
            <div>
                OLA {name}
            </div>
        )  
     }

    return (
        <div className="information">
            <label>Product name:</label>
            <input type={"text"} placeholder="nome do produto..." 
                onChange={(event) => {
                    setName(event.target.value)
                    }}
            />
            <label>Amount:</label>
            <input type={"number"} placeholder="Quantidade..."
                onChange={(event) => {
                    setAmount(event.target.value)
                    }}
            />
            <label>Price:</label>
            <input type={"number"} placeholder="Preco..."
                onChange={(event) => {
                    setPrice(event.target.value)
                    }}
            />
            <label>Details:</label>
            <input type={"text"} placeholder="Detalhes do produto..."
                onChange={(event) => {
                    setDetails(event.target.value)
                    }}
            />
            <label>Description:</label>
            <input type={"text"} placeholder="Pode ser para identificar..."
                onChange={(event) => {
                    setDescription(event.target.value)
                    }}  
            />
            <Botao nome={name} preco={price} addProduct={addProduct}/>
        </div>

    )
}

